profile:
Spring City Window Cleaning is a professional window cleaning service in Barrie and the surrounding areas, serving homeowners, cottagers and commercial businesses in Simcoe County and York Region. We offer No Contact Residential & Commercial Window Cleaning services.

Depending on your needs, your Residential Window Cleaning package can include:

- Exterior window cleaning; 
- Interior window cleaning; 
- Track cleaning; Glass railing cleaning; 
- Screen cleaning; 
- Glass showers and mirrors

Commercial Services we offer:

- Route work: We provide monthly, bi-monthly, weekly window cleaning service to keep your business front sparkling; 
- Car dealerships; 
- We offer exterior and interior window cleaning, as well as glass office partitions cleaning;
- Low-Rise Buildings up to 3 storeys; 
- Homes modified into office spaces

Our services are provided All 4 Seasons.

https://springcitywindowcleaning.ca/
